import React from 'react';

const ReviewInfo = props => {

    return (
      <table>
        <tbody>
          <tr>
            <td><span>Your Name:</span></td>
            <td><span>{props.confirm.name}</span></td>
          </tr>
        </tbody>
      </table>
    )
};

export default ReviewInfo;
